function StaticInit(){$("#minfo-hamburger, #minfo").click(function(){$("#minfodetail").toggleClass("closed")}),$.getJSON("json/samples.json",function(o){for(var n in $("#collection-description").html(o.description),o.collection)$("#load-samples").append('<option value="'+n+'">'+o.collection[n]+"</option>")}),$("#load-samples-btn").click(function(){var o=$("#load-samples").val();window.location.href="#"+o})}$(document).ready(function(){StaticInit()});